import React from 'react'

export default function Home() {
  return (
    <div className='bg home'>
      <div className=" text-center">
      
    <h1 style = {{color : 'yellow'}}className="h1 display-5 fw-bold">QUANTUM PREDICTION MODEL</h1>
    
      
      <div className=" button-class d-grid gap-2 d-sm-flex justify-content-sm-center">
        <button type="button" className="btn btn-success btn-lg px-4 gap-3">Login</button>
        <button type="button" className="btn btn-outline-secondary btn-lg px-4">Sign-Up</button>
      
    </div>
  </div>
    </div>
  );
}
